import styles from './styles.module.css';

const Main = () => {
    const handleLogout = () => {
        localStorage.removeItem("token");
        window.location.reload();
    };

    return (
        <div>
         <header>
            <h1>FocusFish <button className={styles.white_btn} onClick={handleLogout}>Log out</button></h1> 
        </header>   
        <div classname={styles.main_container}>
          <button className={styles.button1}>Button1 </button> <button className={styles.button2}>Button2</button> <button className={styles.button3}>Button3</button>
        
        </div>
        </div>
    )
}

export default Main;
